import Data from '../Services/Datas'
import '../Styles/pages/film.css'
import Sidebar from '../Components/Sidebar'

const Books = () => {
    return (
        <>
            <Sidebar/>
            <div id='container'>
                {
                Datas.map(book => { 
                        return <div key={book.id} className='card'>
                            <img src={book.image} alt='Capa do Livro'/>
                            <h3>{book.name}</h3>
                            <p>Aurota:{book.autor}</p>

                        </div>
                    })
                }
            </div>
        </>
    )
}

export default Books
